import React, {Component} from 'react';
import {
    View,
    KeyboardAvoidingView,
    TextInput,
    StyleSheet,
    Text,
    Platform,
    TouchableWithoutFeedback,
    Button,
    Keyboard,
    SafeAreaView,
    FlatList
} from 'react-native';
import MyButton from "./MyButton";
import Location from './Location'

export default class extends Component {
    render() {
        return [
            <View style={{display: 'flex', flexDirection: 'row'}}><MyButton title={'Pobierz i zapisz pozycję'}
                                                                            action={'save'}
                                                                            navigation={this.props.navigation}/><MyButton
                title={'Usuń wszystkie dane'} action={'delete_all'} navigation={this.props.navigation}/></View>,
            <View> </View>
        ];
    }
}
